CREATE DEFINER=`root`@`localhost` PROCEDURE `doLog`(in logMsg varchar(512))
BEGIN

  Declare continue handler for 1146 

  BEGIN

     call setupTmpLog();

     insert into tmplog values('resetup tmp table');

     insert into tmplog values(logMsg);

  END;

  insert into tmplog values(logMsg);

END ;;
